":{\"count\":20,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":811,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":3,\"user_reposted\":0},\"views\":{\"count\":34819},\"is_favorite\":false},{\"id\":41996,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1582305360,\"marked_as_ads\":0,\"post_type\":\"post\",\"text\":\"Упд: да, к чему я это, во-первых, продемонстрировать, как легко делать «расследования», целая куча инфы на расстоянии всего одной гуглежки. Если я призываю людей, например, на суды по московскому делу, то это не мои фантазии, я ориентируюсь на факты. Во-вторых, когда вам будут затирать «ну ребята, ну мы же одна большая семья, давайте жить дружно, мы будем вести себя как мудаки и делать говно, а вы не будете бухтеть», просто помните, что вас наебывают, вы для них не семья, а лошки, которых надо нахлобучить. Поверите и снимете претензии? Они пропойно продолжат получать 20к за рабочий день. Продолжите бухтеть и дестабилизировать ситуацию в университете? Ну что же, придётся решать проблемы студентов, ради которых они и работают.\\n(Так, и у нас вроде мемы для интеллектуальной элиты, поэтому отвечаю комментаторам, что зп 400к нужна для того, чтобы нанять абстрактного Варламова. Для такой должности нормальная зарплата, я не говорю, что надо платить 40к проректорам. Но тут единая цепочка «должность — компетентность — зарплата». Два из трёх звеньев может и соответствуют друг другу, но соответствуют ли все три?)\",\"attachments\":[{\"type\":\"link\",\"link\":{\"url\":\"https:\\/\\/m.vk.com\\/@-111557607-rassledovanie-400k-zarplaty\",\"title\":\"Расследование. 400к зарплаты.\",\"caption\":\"m.vk.com\",\"description\":\"Статья\",\"photo\":{\"id\":457245570,\"album_id\":-66,\"owner_id\":-111557607,\"user_id\":100,\"sizes\":[{\"type\":\"m\",\"url\":\"https:\\/\\/sun9-56.userapi.com\\/c855536\\/v855536985\\/1c5fd6\\/esx4zw9zyL0.jpg\",\"width\":130,\"height\":77},{\"type\":\"o\",\"url\":\"https:\\/\\/sun9-2.userapi.com\\/c