1581523525,\"post_id\":41812,\"access_key\":\"3852da699755949b1e\"}}],\"post_source\":{\"type\":\"vk\"},\"comments\":{\"count\":15,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":892,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":1,\"user_reposted\":0},\"views\":{\"count\":43376},\"is_favorite\":false},{\"id\":41807,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1581522480,\"marked_as_ads\":0,\"post_type\":\"post\",\"text\":\"Итак, спустя три дня (пинания хуёв и из них двадцати минут) обсуждений результатов конкурса, объявляем трёх победителей!\\nhttps:\\/\\/vk.com\\/phys_kek?w=wall-111557607_41685\\nhttps:\\/\\/vk.com\\/phys_kek?w=wall-111557607_41554\\nhttps:\\/\\/vk.com\\/phys_kek?w=wall-111557607_41109\\nВыбор был сделан на основании мнения подписоты (лайки\\/репосты, сколько пабликов уже успели спиздить тот или иной мем) и субъективном взгляде админов (чтобы исключить накрутку и разницу во времени размещения поста). \\nГодных мемов было чуть больше чем три, поэтому выбор был непростой.\\nДо встречи на следующем конкурсе, будем ждать от вас ещё больше годных мемов!\\nАвторов вышеуказанных мемов просим написать в лс паблика по поводу бесплатного обеда в бургерной \\\"Мак-Дак\\\".\\n\\nПо поводу редбулла участникам напишет наш дилер, он сейчас болеет, но за неделю должен выздороветь.\",\"attachments\":[{\"type\":\"photo\",\"photo\":{\"id\":457245842,\"album_id\":-7,\"owner_id\":-111557607,\"user_id\":100,\"sizes\":[{\"type\":\"m\",\"url\":\"https:\\/\\/sun9-26.userapi.com\\/c858520\\/v858520463\\/db3f7\\/2pkdzLori_I.jpg\",\"width\":130,\"height\":90},{\"type\":\"o\",\"url\":\"https:\\/\\/sun9-18.userapi.com\\/c858520\\/v858520463\\/db3fa\\/Hku1C4xfRwo.jpg\",\"width\":130,\"height\":90},{\"type\":\"p\",\"url\":\"https:\\/\\/sun9-64.userapi.com\\/c858520\\/v858520463\\/db3fb\\/JUJGNhyWR5A.jpg\",\"width\":200,\"height\":139},{\"type\":\"q\",\"url\":\"https:\\/\\/sun9-27.userapi.com\\/c858520\\/v858520463\\/db3fc\\/hAirCs84vto.jpg\",\"width\":320,\"height\":222},{\"type\":\"r\",\"url\":\"https:\\/\\/sun9-25.userapi.com\\/c858520\\/v858520463\\/db3fd\\/hz02q5JYZ3g.jpg\",\"width\":510,\"height\":354},{\"type\":\"s\",\"url\":\"https:\\/\\/sun9-65.userapi.com\\/c858520\\/v858520463\\/db3f6\\/3SPkzvjQySk.jpg\",\"width\":75,\"height\":52},{\"type\":\"x\",\"url\":\"https:\\/\\/sun9-13.userapi.com\\/c858520\\/v858520463\\/db3f8\\/R9aIq2Ijmkk.jpg\",\"width\":604,\"height\":419},{\"type\":\"y\",\"url\":\"https:\\/\\/sun9-71.userapi.com\\/c858520\\/v858520463\\/db3f9\\/bZG_YW-Ya1Q.jpg\",\"width\":688,\"height\":477}],\"text\":\"\",\"date\":1581513405,\"post_id\":41807,\"access_key\":\"1b3e2cb900524129c8\"}}],\"post_source\":{\"type\":\"vk\"},\"comments\":{\"count\":10,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":73,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":0,\"user_reposted\":0},\"views\":{\"count\":21900},\"is_favorite\":false,\"edited\":1581523441},{\"id\":41806,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1581522300,\"marked_as_ads\":1,\"post_type\":\"post\",\"text\":\"Открыта регистрация на кейс-чемпионат Changellenge » Cup Technical 2020 — соревнование по решению инженерных задач из практики крупных российских и зарубежных компаний для студентов и недавних выпускников технических и бизнес-направлений.\\n\\nДве секции на выбор:\\n— ресурсная, где вы разберетесь в преимуществах и рисках аддитивных технологий и узнаете о последних достижениях робототехники;\\n— производственная, где вы сможете оптимизировать производственные процессы и вывести бизнес компании на новый уровень. \\n\\nПри участии вы сможете:\\n— получить опыт, который нельзя приобрести в университете, и прокачать основные soft skills; \\n— заработать плюс к резюме: 90 % лучших работодателей России обращают внимание на участие в кейс-чемпионатах; \\n— начать карьеру в одной из шести компаний-партнеров: Aggreko, P&G, НИПИГАЗе, «Норникеле», EY и Schlumberger. \\n\\nСобирайте команду или подавайте индивидуальную заявку — мы поможем подобрать единомышленников. \\n\\nРегистрация до 9 марта включительно: https:\\/\\/clck.ru\\/MBoVt\",\"attachments\":[{\"type\":\"link\",\"link\":{\"url\":\"https:\\/\\/clck.ru\\/MBoVt\",\"title\":\"Cup Technical 2020\",\"caption\":\"1.changellenge.com\",\"description\":\"Кубок по решению технических кейсов\",\"photo\":{\"id\":457296098,\"album_id\":-28,\"owner_id\":2000053175,\"sizes\":[{\"type\":\"a\",\"url\":\"https:\\/\\/sun9-56.userapi.com\\/c850416\\/v850416271\\/1bc3c3\\/gM_Jiv-K9Wo.jpg\",\"width\":200,\"height\":90},{\"type\":\"b\",\"url\":\"https:\\/\\/sun9-16.userapi.com\\/c850416\\/v850416271\\/1bc3c1\\/k7KBbN4RcCo.jpg\",\"width\":400,\"height\":179},{\"type\":\"c\",\"url\":\"https:\\/\\/sun9-67.userapi.com\\/c850416\\/v850416271\\/1bc3c5\\/Iwxi9Kef50c.jpg\",\"width\":200,\"height\":200},{\"type\":\"d\",\"url\":\"https:\\/\\/sun9-34.userapi.com\\/c850416\\/v850416271\\/1bc3c6\\/qURXY08syP8.jpg\",\"width\":100,\"height\":100},{\"type\":\"e\",\"url\":\"https:\\/\\/sun9-36.userapi.com\\/c850416\\/v850416271\\/1bc3c7\\/1SOG7eZcoIs.jpg\",\"width\":50,\"height\":50},{\"type\":\"k\",\"url\":\"https:\\/\\/sun9-45.userapi.com\\/c850416\\/v850416271\\/1bc3c2\\/OBOSkcnkxBI.jpg\",\"width\":1070,\"height\":480},{\"type\":\"l\",\"url\":\"https:\\/\\/sun9-55.userapi.com\\/c850416\\/v850416271\\/1bc3c4\\/SZ2bx2b30HA.jpg\",\"width\":537,\"height\":240},{\"type\":\"o\",\"url\":\"https:\\/\\/sun9-67.userapi.com\\/c850416\\/v850416271\\/1bc3c0\\/Bvm1VaSpeFU.jpg\",\"width\":1072,\"height\":481}],\"text\":\"\",\"date\":1581411288},\"is_favorite\":false}}],\"post_source\":{\"type\":\"vk\"},\"comments\":{\"count\":0,\"can_post\":0},\"likes\":{\"count\":2,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":0,\"user_reposted\":0},\"views\":{\"count\":14343},\"is_favorite\":false},{\"id\":41689,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1581282116,\"marked_as_ads\":0,\"post_type\":\"