Уж лучше я сбегу.\\nУмоляю, не пытайся ты меня догнать,\\nВсё равно контрольную тебе не собираюсь я сдавать!\\n\\nТяни! Я всё равно не знаю признака Дини.\\nТы все равно мне не поставишь мой уд3.\\nНе сможешь ты заинтересовать меня,\\nВедь точно знаю я, что матанализ твой — херня из-под коня.\\n\\nПовседневкой я опутан с головы до ног.\\nГолодающий сосед сварил себе сапог.\\nА мой семер всё стоит, не хочет уходить.\\nНепонятливый какой,\\nЕму меня не переубедить!\\n\\nТяни! Я не пришёл на пары. Я их пропустил.\\nЯ прозевал все сдачи матана твои.\\nНе сможешь ты теперь им зацепить меня,\\nВедь точно знаю я, что матанализ твой — херня из-под коня.\\n\\nМне не нужно ничего, меня воротит прочь.\\nНикогда не жертвовал экзамену я ночь\\nЯ всегда любил поесть и до утра поспать,\\nЗная, что назавтра мне предрешено контрольную сдавать.\\n\\n\\\"Тяни!\\\" — Ты говоришь, — \\\"Иди сдавать, билет тяни\\\".\\nСмотрю в билет, оттуда на меня — Дини.\\nНикак не сможешь ты поставить неуд мне,\\nОпять мне повезло, я снова на коне.\",\"signer_id\":253200003,\"attachments\":[{\"type\":\"audio\",\"audio\":{\"artist\":\"Король и Шут\",\"id\":456242779,\"owner_id\":2000425381,\"title\":\"Тяни!\",\"duration\":25,\"track_code\":\"55f4459eQHa_IZBeuPTvzHSDbJ2uQivuN2C0AF2Hc2-p2c-CTdGUoTCn4Q\",\"url\":\"https:\\/\\/vk.com\\/mp3\\/audio_api_unavailable.mp3\",\"date\":1581276309,\"no_search\":1,\"main_artists\":[{\"name\":\"Король и Шут\",\"domain\":\"8758602863157116965\",\"id\":\"8758602863157116965\"}]}}],\"post_source\":{\"type\":\"api\",\"platform\":\"iphone\"},\"comments\":{\"count\":3,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":117,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":2,\"user_reposted\":0},\"views\":{\"count\":13921},\"is_favorite\":false},{\"id\":41613,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1581275700,\"marked_as_ads\":0,\"post_type\":\"post\",\"text\":\"На конкурс\\n\\nНе двигайся! Снимаю человека не ботающего факер