\",\"attachments\":[{\"type\":\"photo\",\"photo\":{\"id\":457245643,\"album_id\":-51,\"owner_id\":-111557607,\"user_id\":100,\"sizes\":[{\"type\":\"m\",\"url\":\"https:\\/\\/sun9-50.userapi.com\\/c206524\\/v206524630\\/559ee\\/MwLFU6Mq67I.jpg\",\"width\":130,\"height\":81},{\"type\":\"o\",\"url\":\"https:\\/\\/sun9-47.userapi.com\\/c206524\\/v206524630\\/559f1\\/ZAAXe38DP-k.jpg\",\"width\":130,\"height\":87},{\"type\":\"p\",\"url\":\"https:\\/\\/sun9-32.userapi.com\\/c206524\\/v206524630\\/559f2\\/dfgmGY5Xctk.jpg\",\"width\":200,\"height\":133},{\"type\":\"q\",\"url\":\"https:\\/\\/sun9-6.userapi.com\\/c206524\\/v206524630\\/559f3\\/CdjKEqfqIxo.jpg\",\"width\":320,\"height\":213},{\"type\":\"r\",\"url\":\"https:\\/\\/sun9-18.userapi.com\\/c206524\\/v206524630\\/559f4\\/_ZQeE2VCUAw.jpg\",\"width\":510,\"height\":340},{\"type\":\"s\",\"url\":\"https:\\/\\/sun9-43.userapi.com\\/c206524\\/v206524630\\/559ed\\/wnvju3f-v7c.jpg\",\"width\":75,\"height\":47},{\"type\":\"x\",\"url\":\"https:\\/\\/sun9-36.userapi.com\\/c206524\\/v206524630\\/559ef\\/Hc9AOcVt1Vw.jpg\",\"width\":604,\"height\":377},{\"type\":\"y\",\"url\":\"https:\\/\\/sun9-4.userapi.com\\/c206524\\/v206524630\\/559f0\\/rDl3eeIKx6c.jpg\",\"width\":800,\"height\":500}],\"text\":\"\",\"date\":1580817740,\"post_id\":41073,\"access_key\":\"f1c6de3f14b09567dd\"}}],\"post_source\":{\"type\":\"vk\"},\"comments\":{\"count\":4,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":15,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":0,\"user_reposted\":0},\"views\":{\"count\":14375},\"is_favorite\":false},{\"id\":41066,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1580922011,\"marked_as_ads\":0,\"post_type\":\"post\",\"text\":\"\uD83D\uDC13\uD83D\uDC13\uD83D\uDC13 КОНКУРС МЕМОВ \uD83D\uDC13\uD83D\uDC13\uD83D\uDC13\\nБудет длиться три дня, до вечера субботы 8 февраля 23:59.\\n\\nУ Физкека день рождения 11 января, теперь мы самые настоящие бакалавры мемологии. В честь этого с месячным опозданием устраиваем КОНКУРС МЕМОВ\uD83E\uDD20\uD83E\uDD20\uD83E\uDD20 (Ну и еще типа первый день учебы, если кто не заметил).\\n\\nКидай свои охуительно смешные мемы в предложку с пометкой \\\"на конкурс\\\". Будут призы, всё как в науке— работаем за еду. Авторы трех лучших мемов получат сертификаты на бесплатный обед(бургер+картошка+напиток) для себя и трех друзей за первое место, себя одного друга за второе и просто бесплатный обед за третье место в бургерной \\\"Мак-Дак\\\" на первомайской 9\\/4. Про другие призы расскажем в следующих постах. \\n\\nНу что, устроим полный \uD83E\uDD23Х\uD83E\uDD23О\uD83E\uDD23Х\uD83E\uDD23О\uD83E\uDD23Т\uD83E\uDD23А\uD83E\uDD23Ч\uD83E\uDD23?\",\"post_source\":{\"type\":\"vk\"},\"comments\":{\"count\":12,\"can_post\":1,\"groups_can_post\":true},\"likes\":{\"count\":40,\"user_likes\":0,\"can_like\":1,\"can_publish\":1},\"reposts\":{\"count\":0,\"user_reposted\":0},\"views\":{\"count\":15991},\"is_favorite\":false},{\"id\":41046,\"from_id\":-111557607,\"owner_id\":-111557607,\"date\":1580817482,\"marked_as_ads\":0,\"post_type\":\"post\",\"text\":\"\",\"attachments\":[{\"type\":\"photo\",\"photo\":{\"id\":457245642,\"album_id\":-7,\"owner_id\":-111557607,\"user_id\":100,\"sizes\":[{\"type\":\"m\",\"url\":\"https:\\/\\/sun9-7.userapi.com\\/c854128\\/v854128922\\/1e8467\\/Z--A-aMZQlI.jpg\",\"width\":117,\"height\":130},{\"type\":\"o\",\"url\":\"https:\\/\\/sun9-65.userapi.com\\/c854128\\/v854128922\\/1e846c\\/qJEjiWhbXCo.jpg\",\"width\":130,\"height\":145},{\"type\":\"p\",\"url\":\"https:\\/\\/sun9-54.userapi.com\\/c854128\\/v854128922\\/1e846d\\/QL_GfxhkhU4.jpg\",\"width\":200,\"height\":222},{\"type\":\"q\",\"url\":\"https:\\/\\/sun9-27.userapi.com\\/c854128\\/v854128922\\/1e846e\\/_0AQ__8xliQ.jpg\",\"width\":320,\"height\":356},{\"type\":\"r\",\"url\":\"https:\\/\\/sun9-53.userapi.com\\/c854128\\/v854128922\\/1e846f\\/u0gQ-gSw4qM.jpg\",\"width\":510,\"height\":568},{\"type\":\"s\",\"url\":\"https:\\/\\/sun9-22.userapi.com\\/c85